window.bookSummaryJSON = "<p>You Are What You Eat... </p> <p>At a genetics lab where a revolutionary strain of corn is being developed, FBI Special Agent Jack Dawson's best friend and fellow agent is brutally murdered, his body torn apart. Jack is convinced that Naomi Perrault, a beautiful geneticist and suspected terrorist, is behind the murder. But when Jack is framed for setting off a bomb that devastates the FBI lab in Quantico, Naomi becomes Jack's only hope of survival. </p> <p>Confronted by the terrifying truth of what the genetically engineered seeds stolen by his friend are truly for and who is really behind them, Jack joins Naomi in a desperate fight across half the globe to save humanity from extermination....</p>"; 
